import React from "E:/keeper-app-part-1/node_modules/react";
import notes from "././notes.js";

function Note(props){
    const note=(
        <div className="note">
           <h1>{props.title}</h1>
           <p>{props.content}</p>
        </div>
    );
    return note;
}

export default Note;
